import * as Grid from '../Grid/Grid';

import './Nav.scss';

const Navigation = function() {
    return (
        <Grid.Navbar bg="white">
            <Grid.Container>
                <Grid.Navbar.Brand href="#"></Grid.Navbar.Brand>
                <Grid.Navbar.Collapse className="justify-content-md-end">
                    <Grid.Nav className="d-none d-md-flex">
                        <Grid.Nav.Link href="https://www.develop.realtystore.com/Membersite/?from=banner">
                            <i class="fa fa-user"></i> Member Sign-in
                        </Grid.Nav.Link>
                    </Grid.Nav>
                    <Grid.Nav className="d-md-none">
                        <span class="d-inline d-md-none mobile-h1 text-primary w-100 text-left"><span class="d-inline d-md-none">0 matching listings</span></span>
                        <Button href="https://www.develop.realtystore.com/signup.html?from=banner" variant="outline-dark" size="sm" className="d-md-none align-self-end join-btn">Join</Button>
                    </Grid.Nav>
                </Grid.Navbar.Collapse>
            </Grid.Container>
        </Grid.Navbar>
    )
}

export default Navigation;
